        {
            __builder.AddMarkupContent(0, "<section>\n    <nav aria-label=\"breadcrumb\">\n        <ol class=\"breadcrumb\">\n            <li class=\"breadcrumb-item\">\n                <a href=\"/\">\n                    <i class=\"fas fa-home\"></i>&nbsp;Domov\n                </a>\n            </li>\n            <li class=\"breadcrumb-item\">\n                <a href=\"/articles\">\n                    <i class=\"fas fa-newspaper\"></i>&nbsp;Články\n                </a>\n            </li>\n            <li class=\"breadcrumb-item active\">\n                Rozhovor o Kadúbku\n            </li>\n        </ol>\n    </nav>\n\n    <article class=\"p-3\">\n        <h3>Aké zmeny boli vykonane v rámci projektu?</h3>\n        <p class=\"ml-3\">Na celom areáli sa podpísal zub času a nebol nijako inak využívaný. Zásadnou zmenou bolo vybudovanie jazierka, ktoré je napájane stálym prítokom Kadúbkovej vody. Vzniká tu esteticky upravený svet mokrade podobný tomu, ktorý v minulosti na tomto mieste bol. Ďalším zaujímavým prvkom je dažďova záhrada. Je to zásaková jama so štrkom kam steká zrážková voda s cesty. Na brehu pri potoku je vysadni pás motýlej luky, ktorá sa nemusí tak často kosiť. Cely areál slúži ako oddychová zóna s dostatočným počtom lavičiek. Bezpochybne dominantou celého parku je zastrešenie samotného prameňa. Hrdzavú rúru nahradila rustikálna kamenná kašna. Masívna murovaná stavba vychádza z prvkov miestnej ľudovej architektúry. Štít zdobí odliatok starožitného erbu sv.Kataríny. Dlažbu tvoria tehly s historickou hodnotou, pochádzajúce s predošlého kostola.</p>\n\n        <h3>Akým spôsobom je financovaný cely projekt?</h3>\n        <p class=\"ml-3\">Pri tomto štartovnom projekte sme sa snažili vyhnúť zdĺhavému a komplikovanému procesu pre získanie grantov. Cely projekt sme do detailov vypracovali a naplánovali my Rodani. Takisto sme vykonali všetky odborne prace formou dobrovoľných brigád. Obecne financie boli použite len pre nákup potrebného materiálu. Za týchto podmienok je suma 4tis. zanedbateľná v porovnaní s výsledným dielom.</p>\n\n        <h3>Kto sa bude starať o údržbu areálu?</h3>\n        <p class=\"ml-3\">O bežnú údržbu sa tak ako doteraz bude starať obec. Vďaka zrovnanému terénu sa kosenie jednoduchší. O jazierko sa stará naše združenie.</p>\n\n        <h3>Ľudia majú obavy z premnoženia komárov. Počítate aj s týmto faktorom?</h3>\n        <p class=\"ml-3\">Samozrejme, pri projektovaní sme sa snažili eliminovať všetky nepriaznivé vplyvy. V prvom rade jazierko očkujeme ,,živou vodou\" obsahujúcu mikroorganizmy a planktón, ktorý sa živí larvami. Ako hlavný požierači komárov sú malé okrasne rybky.</p>\n\n        <h3>Do akej miery je myslene na bezpečnosť v areáli?</h3>\n        <p class=\"ml-3\">Jazierko nie je koncipovane ako kúpacie a je doň zákaz vstupu. Maximálna hĺbka je 1.7m a nie je prístupná z brehu. Veľká časť jazierka je plytká, lemovaná kameňmi. V hlbokej časti sme použili zaujímavý prvok - plávajúci ostrov, ktorý môže v núdzi poslúžiť ako záchranne koleso.</p>\n\n        <h3>Čo všetko nám areál môže ponúknuť?</h3>\n        <p class=\"ml-3\">Cely park sa snažíme designovať tak, aby pôsobil uskladňujúco a stal sa prijemným miestom pre odpočinok. Potôčik je vystlaný okrúhlymi kameňmi a vďaka hladkej vode sa tvári ako horská bystrinka po ktorej sa da chodiť a otužovať sa. Kadúbek ma potenciál stáť sa vyhľadávaným miestom pre cyklistov a turistov.</p>\n    </article>\n</section>");
